import React,{useState} from "react";
import './Header.css';
import { useDispatch} from 'react-redux';
import {fetchAsyncImages} from "../features/Images/imageSlice"; 
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
// import { useNavigate } from 'react-router-dom';

const Header = () => {
    const [query, setQuery] = useState(" ");
    const dispatch=useDispatch();
    // const history = useNavigate();

    const submitHandler = (e) => {
        e.preventDefault();
        dispatch(fetchAsyncImages(query));
        // history(`/${query}`);
        setQuery("");
      };

    return (
        <div>
            <div className="container">
                <form className="form" onSubmit={submitHandler} >
                <Router>
                    <Routes>
                        <Route exact path="/" element={<Tree/>} />
                    </Routes>
                </Router>
                    <input type="text" value={query} placeholder="search images" className="searchbar" onChange={(e)=> setQuery(e.target.value)}></input>
                    <button type="submit">Search</button>
                </form>
                <div className="button-images">
                        <button type="button" onClick={(e) => { dispatch(fetchAsyncImages("Jaipur"));}}>Jaipur</button>
                        <button type="button" onClick={(e) => { dispatch(fetchAsyncImages("Mumbai"));}}>Mumbai</button>
                        <button type="button" onClick={(e) => { dispatch(fetchAsyncImages("Goa"));}}>Goa</button>
                    </div>
            </div>
        </div>
    );
};

export default Header;
